M : 3% in weight, rich in vitamins and good fats\n\nAsh content : measures the amount of mineral content that remains in the flour after milling. \nAs mineral mostly is on the outside of the kernel, the higher the ash content , the more bran and outer layers you’ll get.\n\nLower protein content is great fro making cookies and pies, and short pastries : THAT crumbly texture. Higher protein content = higher gluten in the dough, is great for baking bread , or even pizza : THAT chewy texture\n\n***********************\n*  LOVE \u0026 SUPPORT  *\n***********************\nSupport my work on : https://www.patreon.com/frenchguycooking\n--\nPatreon is a cool way for creators to achieve a sustainable income by being financially supported by their lovely community ! You get to do something GOOD and, icing on cake, you also get different types of rewards !  \n\n****************\n*  SUBTITLES  *\n****************\nYou want to Help everyone understand that F* French ??\nSubmit your own subtitle in any language here : http://www.youtube.com/timedtext_cs_panel?tab=2\u0026c=UCPzFLpOblZEaIx2lpym1l1A\n\n**********\n* MUSIC *\n**********\nMusic by ProleteR\nhttps://proleter.bandcamp.com/\nhttps://soundcloud.com/proleter-beatmaker\n\n***************\n*  MERCH      *\n***************\nI have my own BRAND ! Stickers, posters and Pizza Shirt and Power-drill guns in the kitchen :) Buy them and support the French Guy's adventures on : http://www.dftba.com/frenchguycooking\n\n***************\n* FACEBOOK *\n***************\nhttp://www.facebook.com/frenchguycooking for mouth watering photos and good discussions ;)\n\n*****************\n* INSTAGRAM *\n*****************\nhttp://instagram.com/frenchguycooking\n\n*************\n* TWITTER *\n*************\nhttp://www.twitter.com/frenchguycookin\n\n**************************\n* COOKBOOK PROJECT *\n**************************\nI am thinking of making an über cool cookbook, so if you are interested, drop me a line there : http://www.frenchguycooking.com Protein Content and Flour Strength. Achoo.\n\nLink to the series : https://www.youtube.com/playlist?list=PLURsDaOr8hWWSiMZBLGP2UEs8w3nQDTVY\n\nUnderstanding the kernel of wheat, is at the core of understanding flour, which might sound like a grind, but it’s useful to understand dough, which is absolutely needed to understand bread itself, so sit back, and don’t be so sour.\n\n2 main categories of wheat in the world :\n- common wheat : Triticum aestivum : \n- durum wheat : Triticum durum : \n\nBRAN ; the Outside rich in fibers and minerals 14% in weight\nENDOSPERM : 83% in weight\nlast time, he said Fuck, now he says sperm, what’s the next one ?\nNo, I Endosperm is the big central part, rich in starch so carbs, and proteins,\nGERM : 3% in weight, rich in vitamins and good fats\n\nAsh content : measures the amount of mineral content that remains in the flour after milling. \nAs mineral mostly is on the outside of the kernel, the higher the ash content , the more bran and outer layers you’ll get.\n\nLower protein content is great fro making cookies and pies, and short pastries : THAT crumbly texture. Higher protein content = higher gluten in the dough, is great for baking bread , or even pizza : THAT chewy texture\n\n***********************\n*  LOVE \u0026 SUPPORT  *\n***********************\nSupport my work on : https://www.patreon.com/frenchguycooking\n--\nPatreon is a cool way for creators to achieve a sustainable income by being financially supported by their lovely community ! You get to do something GOOD and, icing on cake, you also get different types of rewards !  \n\n****************\n*  SUBTITLES  *\n****************\nYou want to Help everyone understand that F* French ??\nSubmit your own subtitle in any language here : http://www.youtube.com/timedtext_cs_panel?tab=2\u0026c=UCPzFLpOblZEaIx2lpym1l1A\n\n**********\n* MUSIC *\n**********\nMusic by ProleteR\nhttps://proleter.bandcamp.com/\nhttps://soundcloud.com/proleter-beatmaker\n\n***************\n*  MERCH v1/browse"}},"browseEndpoint":{"browseId":"UCPzFLpOblZEaIx2lpym1l1A","canonicalBaseUrl":"/@FrenchGuyCooking"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/BBhUVZvNHHRS92tKppr6ml6M1y_UaC6Y79OBWWrwaw7LegHIRSVrYNlLA0Tq4P5nUntWF5544ts=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Wheat Flours 101 ! Basics, Ash content, Protein Content and Flour Strength. Achoo.\n\nLink to the series :    • Sourdough Bread Odyssey  \n\nUnderstanding the kernel of wheat, is at the core of understanding flour, which might sound like a grind, but it’s useful to understand dough, which is absolutely needed to understand bread itself, so sit back, and don’t be so sour.\n\n2 main categories of wheat in the world :\n- common wheat : Triticum aestivum : \n- durum wheat : Triticum durum : \n\nBRAN ; the Outside rich in fibers and minerals 14% in weight\nENDOSPERM : 83% in weight\nlast time, he said Fuck, now he says sperm, what’s the next one ?\nNo, I Endosperm is the big central part, rich in starch so carbs, and proteins,\nGERM : 3% in weight, rich in vitamins and good fats\n\nAsh content : measures the amount of mineral content that remains in the flour after milling. \nAs mineral mostly is on the outside of the kernel, the higher the ash content , the more bran and outer layers you’ll get.\n\nLower protein content is great fro making cookies and pies, and short pastries : THAT crumbly texture. Higher protein content = higher gluten in the dough, is great for baking bread , or even pizza : THAT chewy texture\n\n***********************\n*  LOVE \u0026 SUPPORT  *\n***********************\nSupport my work on :   / frenchguycooking  \n--\nPatreon is a cool way for creators to achieve a sustainable income by being financially supported by their lovely community ! You get to do something GOOD and, icing on cake, you also get
